const Header = ({open, setOpen}) => {
    return ( 
        <header>
            <NavLink to="/">biker shop</NavLink>
            <Icon icon={menuIcon} width="75px" onClick={() => setOpen(!open)} />
        </header>
     );
}

export default Header;
